import { Link } from 'react-router-dom';

function ArtDescription({ gallery, art }) {
    return (
        <div>
            <Link to={`/galleries/${gallery.id}`}>
                {`Back to ${gallery.name} Gallery`}
            </Link>

            <Link to={art.url}>
                {art.title}
            </Link>
        </div>
    );
}

export default ArtDescription;
